precis:
Regulations Amending CERTAIN DEPARTMENT OF TRANSPORT REGULATIONS
(MISCELLANEOUS PROGRAM) by making minor changes to:
.
- the Public Ports and Public Port Facilities Regulations;
- the Large Fishing Vessel Inspection Regulations;
- the Ship Registration and Tonnage Regulations;
- the Navigating Appliances and Equipment Regulations; and
- the Motor Vehicle Safety Regulations.
